    // --- 堆叠 & 比例尺 ---
    const stack  = d3.stack().keys(keys).offset(d3.stackOffsetSilhouette);
    let series = stack(adjusted);

    // 仅保留有非零面积的数据段（即至少有一个点 y1 > y0）
    series = series.filter(layer =>
      layer.some(d => Math.abs(d[1] - d[0]) > 1e-6)
    );

    const margin = { top: 20, right: 5, bottom: 18, left: 5 }; // 顶部预留标题
    const x = d3.scaleUtc()
      .domain(d3.extent(adjusted, d => d.adjDate))
      .range([margin.left, width - margin.right]);

    const y = d3.scaleLinear()
      .domain([
        d3.min(series, s => d3.min(s, d => d[0])),
        d3.max(series, s => d3.max(s, d => d[1]))
      ])
      .range([height - margin.bottom, margin.top]);

    // --- 区域 ---
    const area = d3.area()
      .x(d => x(d.data.adjDate))
      .y0(d => y(d[0]))
      .y1(d => y(d[1]))
      .curve(d3.curveBasis);

