    if (firstRender) {
      const clip = svg.append("defs")
        .append("clipPath")
        .attr("id", "reveal-clip")
        .append("rect")
        .attr("x", margin.left)
        .attr("y", margin.top)
        .attr("width", 0)
        .attr("height", height - margin.top - margin.bottom);

      clip.transition()
        .duration(600)                // 0.6 秒
        .attr("width", width - margin.right);
    }

